import React from 'react';
import './index.css';


function Blog({items}){

    const direction = (index, item) => {
        if(index%2 === 0){
            return(
                <img src={item.pic}/>
            );
        }
        else{
            return(
                <img src={item.pic}/>
            );
        }
    }

    return(
        <div className='blocks'>
            
            { items && items.map( (item, index) => (
                <div className={index%2 === 0 ? 'item1' : 'item2'} key={`${item}_${index}`}>
                    {direction(item, index)}
                    {item.title}
                    {direction(item, index)}
                </div>
            ))
            }
        </div> 
        );
}


export default Blog;
